import React from "react";
import {
  BrowserRouter,
  NavLink,
  Outlet,
  Route,
  Routes,
} from "react-router-dom";

const Root = () => {
  return (
    <BrowserRouter>
      <div>
        <Routes>
          <Route
            element={
              <div>
                <NavLink to="/home">home</NavLink>
                <NavLink to="about">about</NavLink>
                <NavLink to="contact">contact</NavLink>
                <Outlet />
              </div>
            }
          >
            <Route path="/home" element={<span>home</span>} />
            <Route path="about" element={<span>about</span>} />
            <Route path="contact" element={<span>contact</span>} />
            <Route path="*" element={<span>404 page</span>} />
          </Route>
        </Routes>
      </div>
    </BrowserRouter>
  );
};

export default Root;
